    "import numpy as np\n",
    "import pandas as pd\n",
    "import matplotlib.pyplot as plt\n",
    "import seaborn as sns\n",
    "from sklearn.preprocessing import MinMaxScaler\n",
    "from sklearn.metrics import mean_squared_error, mean_absolute_error\n",
    "import tensorflow as tf\n",
    "from tensorflow.keras.models import Model\n",
    "from tensorflow.keras.layers import (\n",
    "    LSTM, Dense, Input, Layer, MultiHeadAttention,\n",
    "    LayerNormalization, Dropout, Conv1D\n",
    ")\n",
    "from tensorflow.keras.optimizers import Adam\n",
    "from tensorflow.keras.callbacks import EarlyStopping, ReduceLROnPlateau\n",
    "import warnings\n",
    "warnings.filterwarnings('ignore')\n",
    "\n",
    "print(\"TensorFlow version:\", tf.__version__)\n",
    "\n",
    "# Set random seeds for reproducibility\n",
    "np.random.seed(42)\n",
    "tf.random.set_seed(42)\n",
    "\n",
    "class AttentionLayer(Layer):\n",
    "    \"\"\"Custom attention layer for time series\"\"\"\n",
    "    def __init__(self, **kwargs):\n",
    "        super(AttentionLayer, self).__init__(**kwargs)\n",
    "\n",
    "    def build(self, input_shape):\n",
    "        self.W = self.add_weight(name=\"att_weight\", shape=(input_shape[-1], 1),\n",
    "                                initializer=\"normal\")\n",
    "        self.b = self.add_weight(name=\"att_bias\", shape=(input_shape[1], 1),\n",
    "                                initializer=\"zeros\")\n",
    "        super(AttentionLayer, self).build(input_shape)\n",
    "\n",
    "    def call(self, x):\n",
    "        e = tf.tanh(tf.matmul(x, self.W) + self.b)\n",
    "        a = tf.nn.softmax(e, axis=1)\n",
    "        output = x * a\n",
    "        return tf.reduce_sum(output, axis=1), a\n",
    "\n",
    "class TimeSeriesGenerator:\n",
    "    \"\"\"Generate synthetic multivariate time series data\"\"\"\n",
    "    \n",
    "    def __init__(self, n_samples=1000, n_features=4, seasonality=50, trend=0.001, noise_level=0.1):\n",
    "        self.n_samples = n_samples\n",
    "        self.n_features = n_features\n",
    "        self.seasonality = seasonality\n",
    "        self.trend = trend\n",
    "        self.noise_level = noise_level\n",
    "        \n",
    "    def generate_data(self):\n",
    "        \"\"\"Generate synthetic multivariate time series\"\"\"\n",
    "        time = np.arange(self.n_samples)\n",
    "        \n",
    "        # Base signals with different seasonalities and trends\n",
    "        features = []\n",
    "        \n",
    "        # Feature 1: Strong seasonality + trend\n",
    "        feature1 = (np.sin(2 * np.pi * time / self.seasonality) + \n",
    "                   0.5 * np.sin(2 * np.pi * time / (self.seasonality / 2)) +\n",
    "                   self.trend * time)\n",
    "        \n",
    "        # Feature 2: Different seasonality + weaker trend\n",
    "        feature2 = (np.cos(2 * np.pi * time / (self.seasonality * 1.5)) + \n",
    "                   0.3 * np.sin(2 * np.pi * time / (self.seasonality / 3)) +\n",
    "                   self.trend * 0.5 * time)\n",
    "        \n",
    "        # Feature 3: Random walk component\n",
    "        feature3 = np.cumsum(np.random.normal(0, 0.1, self.n_samples))\n",
    "        \n",
    "        # Feature 4: Combination of others with lag\n",
    "        feature4 = 0.7 * np.roll(feature1, 5) + 0.3 * feature2 + np.random.normal(0, 0.05, self.n_samples)\n",
    "        \n",
    "        features = np.column_stack([feature1, feature2, feature3, feature4])\n",
    "        \n",
    "        # Add correlated noise\n",
    "        covariance = np.array([[1.0, 0.7, 0.3, 0.6],\n",
    "                              [0.7, 1.0, 0.2, 0.5],\n",
    "                              [0.3, 0.2, 1.0, 0.4],\n",
    "                              [0.6, 0.5, 0.4, 1.0]])\n",
    "        \n",
    "        correlated_noise = np.random.multivariate_normal(\n",
    "            mean=np.zeros(self.n_features), \n",
    "            cov=covariance, \n",
    "            size=self.n_samples\n",
    "        )\n",
    "        \n",
    "        data = features + self.noise_level * correlated_noise\n",
    "        \n",
    "        # Create target as nonlinear combination of features\n",
    "        target = (0.4 * data[:, 0] + 0.3 * data[:, 1] + \n",
    "                 0.2 * data[:, 2] + 0.1 * data[:, 3] +\n",
    "                 0.1 * data[:, 0] * data[:, 1] +\n",
    "                 np.sin(2 * np.pi * time / 100) * 0.2)\n",
    "        \n",
    "        return data, target\n",
    "\n",
    "class TimeSeriesPreprocessor:\n",
    "    \"\"\"Preprocess time series data for LSTM models\"\"\"\n",
    "    \n",
    "    def __init__(self, lookback=60, train_ratio=0.7, val_ratio=0.15):\n",
    "        self.lookback = lookback\n",
    "        self.train_ratio = train_ratio\n",
    "        self.val_ratio = val_ratio\n",
    "        self.scaler_x = MinMaxScaler()\n",
    "        self.scaler_y = MinMaxScaler()\n",
    "        \n",
    "    def prepare_data(self, data, target):\n",
    "        \"\"\"Prepare data for LSTM training\"\"\"\n",
    "        # Scale features\n",
    "        data_scaled = self.scaler_x.fit_transform(data)\n",
    "        target_scaled = self.scaler_y.fit_transform(target.reshape(-1, 1)).flatten()\n",
    "        \n",
    "        # Create sequences\n",
    "        X, y = [], []\n",
    "        for i in range(self.lookback, len(data_scaled)):\n",
    "            X.append(data_scaled[i-self.lookback:i])\n",
    "            y.append(target_scaled[i])\n",
    "        \n",
    "        X, y = np.array(X), np.array(y)\n",
    "        \n",
    "        # Split data\n",
    "        n = len(X)\n",
    "        train_end = int(n * self.train_ratio)\n",
    "        val_end = train_end + int(n * self.val_ratio)\n",
    "        \n",
    "        X_train, y_train = X[:train_end], y[:train_end]\n",
    "        X_val, y_val = X[train_end:val_end], y[train_end:val_end]\n",
    "        X_test, y_test = X[val_end:], y[val_end:]\n",
    "        \n",
    "        return (X_train, y_train, X_val, y_val, X_test, y_test)\n",
    "\n",
    "def create_attention_lstm(lookback, n_features, lstm_units=100, dropout_rate=0.2):\n",
    "    \"\"\"Create Attention-based LSTM model\"\"\"\n",
    "    \n",
    "    inputs = Input(shape=(lookback, n_features))\n",
    "    \n",
    "    # LSTM layers\n",
    "    lstm_out = LSTM(lstm_units, return_sequences=True, dropout=dropout_rate)(inputs)\n",
    "    lstm_out = LSTM(lstm_units, return_sequences=True, dropout=dropout_rate)(lstm_out)\n",
    "    \n",
    "    # Attention mechanism\n",
    "    attention = AttentionLayer()\n",
    "    attention_out, attention_weights = attention(lstm_out)\n",
    "    \n",
    "    # Output layer\n",
    "    outputs = Dense(1)(attention_out)\n",
    "    \n",
    "    model = Model(inputs=inputs, outputs=outputs)\n",
    "    \n",
    "    # Store attention weights for later access\n",
    "    model.attention_weights = attention_weights\n",
    "    \n",
    "    return model\n",
    "\n",
    "def create_standard_lstm(lookback, n_features, lstm_units=100, dropout_rate=0.2):\n",
    "    \"\"\"Create standard LSTM model for comparison\"\"\"\n",
    "    \n",
    "    inputs = Input(shape=(lookback, n_features))\n",
    "    \n",
    "    lstm_out = LSTM(lstm_units, return_sequences=True, dropout=dropout_rate)(inputs)\n",
    "    lstm_out = LSTM(lstm_units, dropout=dropout_rate)(lstm_out)\n",
    "    \n",
    "    outputs = Dense(1)(lstm_out)\n",
    "    \n",
    "    model = Model(inputs=inputs, outputs=outputs)\n",
    "    return model\n",
    "\n",
    "def calculate_metrics(y_true, y_pred):\n",
    "    \"\"\"Calculate evaluation metrics\"\"\"\n",
    "    mse = mean_squared_error(y_true, y_pred)\n",
    "    rmse = np.sqrt(mse)\n",
    "    mae = mean_absolute_error(y_true, y_pred)\n",
    "    mape = np.mean(np.abs((y_true - y_pred) / y_true)) * 100\n",
    "    \n",
    "    return rmse, mae, mape\n",
    "\n",
    "def plot_training_history(history, title):\n",
    "    \"\"\"Plot training history\"\"\"\n",
    "    fig, (ax1, ax2) = plt.subplots(1, 2, figsize=(12, 4))\n",
    "    \n",
    "    ax1.plot(history.history['loss'], label='Training Loss')\n",
    "    ax1.plot(history.history['val_loss'], label='Validation Loss')\n",
    "    ax1.set_title(f'{title} - Loss')\n",
    "    ax1.set_xlabel('Epoch')\n",
    "    ax1.set_ylabel('Loss')\n",
    "    ax1.legend()\n",
    "    ax1.grid(True)\n",
    "    \n",
    "    ax2.plot(history.history.get('mae', history.history['loss']), label='Training MAE')\n",
    "    ax2.plot(history.history.get('val_mae', history.history['val_loss']), label='Validation MAE')\n",
    "    ax2.set_title(f'{title} - MAE')\n",
    "    ax2.set_xlabel('Epoch')\n",
    "    ax2.set_ylabel('MAE')\n",
    "    ax2.legend()\n",
    "    ax2.grid(True)\n",
    "    \n",
    "    plt.tight_layout()\n",
    "    plt.show()\n",
    "\n",
    "def plot_predictions(y_true, y_pred, title, sample_size=200):\n",
    "    \"\"\"Plot true vs predicted values\"\"\"\n",
    "    plt.figure(figsize=(12, 6))\n",
    "    \n",
    "    # Plot a sample for clarity\n",
    "    if len(y_true) > sample_size:\n",
    "        plot_range = slice(-sample_size, None)\n",
    "    else:\n",
    "        plot_range = slice(None)\n",
    "    \n",
    "    plt.plot(y_true[plot_range], label='True Values', alpha=0.7, linewidth=2)\n",
    "    plt.plot(y_pred[plot_range], label='Predictions', alpha=0.7, linestyle='--')\n",
    "    plt.title(f'{title} - Predictions vs True Values')\n",
    "    plt.xlabel('Time Steps')\n",
    "    plt.ylabel('Scaled Values')\n",
    "    plt.legend()\n",
    "    plt.grid(True, alpha=0.3)\n",
    "    plt.show()\n",
    "\n",
    "def plot_attention_weights(model, X_sample, sample_idx=0, lookback=60):\n",
    "    \"\"\"Plot attention weights for a specific sample\"\"\"\n",
    "    \n",
    "    # Create a model that outputs attention weights\n",
    "    attention_model = Model(inputs=model.input, \n",
    "                           outputs=model.attention_weights)\n",
    "    \n",
    "    # Get attention weights for the sample\n",
    "    attention_weights = attention_model.predict(X_sample[sample_idx:sample_idx+1])\n",
    "    attention_weights = attention_weights.reshape(-1)\n",
    "    \n",
    "    # Plot attention weights\n",
    "    plt.figure(figsize=(12, 6))\n",
    "    time_steps = range(lookback)\n",
    "    \n",
    "    plt.bar(time_steps, attention_weights, alpha=0.7, color='steelblue')\n",
    "    plt.xlabel('Time Steps (Lookback Period)')\n",
    "    plt.ylabel('Attention Weight')\n",
    "    plt.title(f'Attention Weights for Sample {sample_idx}')\n",
    "    plt.grid(True, alpha=0.3)\n",
    "    \n",
    "    # Highlight the most important time steps\n",
    "    top_5_idx = np.argsort(attention_weights)[-5:][::-1]\n",
    "    for idx in top_5_idx:\n",
    "        plt.axvline(x=idx, color='red', linestyle='--', alpha=0.8, \n",
    "                   label=f'Top attention: step {idx}' if idx == top_5_idx[0] else \"\")\n",
    "    \n",
    "    if len(top_5_idx) > 0:\n",
    "        plt.legend()\n",
    "    \n",
    "    plt.tight_layout()\n",
    "    plt.show()\n",
    "    \n",
    "    return top_5_idx, attention_weights\n",
    "\n",
    "def ablation_study(X_train, y_train, X_val, y_val, X_test, y_test, lookback, n_features):\n",
    "    \"\"\"Perform ablation study comparing Attention-LSTM vs Standard LSTM\"\"\"\n",
    "    \n",
    "    print(\"=\" * 60)\n",
    "    print(\"PERFORMING ABLATION STUDY\")\n",
    "    print(\"=\" * 60)\n",
    "    \n",
    "    results = {}\n",
    "    \n",
    "    # Train Attention-LSTM\n",
    "    print(\"\\n1. Training Attention-LSTM Model...\")\n",
    "    attention_model = create_attention_lstm(lookback, n_features)\n",
    "    attention_model.compile(optimizer=Adam(learning_rate=0.001), \n",
    "                          loss='mse', metrics=['mae'])\n",
    "    \n",
    "    attention_history = attention_model.fit(\n",
    "        X_train, y_train,\n",
    "        validation_data=(X_val, y_val),\n",
    "        epochs=100,\n",
    "        batch_size=32,\n",
    "        callbacks=[\n",
    "            EarlyStopping(patience=15, restore_best_weights=True),\n",
    "            ReduceLROnPlateau(patience=10, factor=0.5)\n",
    "        ],\n",
    "        verbose=0\n",
    "    )\n",
    "    \n",
    "    # Train Standard LSTM\n",
    "    print(\"\\n2. Training Standard LSTM Model...\")\n",
    "    standard_model = create_standard_lstm(lookback, n_features)\n",
    "    standard_model.compile(optimizer=Adam(learning_rate=0.001), \n",
    "                         loss='mse', metrics=['mae'])\n",
    "    \n",
    "    standard_history = standard_model.fit(\n",
    "        X_train, y_train,\n",
    "        validation_data=(X_val, y_val),\n",
    "        epochs=100,\n",
    "        batch_size=32,\n",
    "        callbacks=[\n",
    "            EarlyStopping(patience=15, restore_best_weights=True),\n",
    "            ReduceLROnPlateau(patience=10, factor=0.5)\n",
    "        ],\n",
    "        verbose=0\n",
    "    )\n",
    "    \n",
    "    # Evaluate models\n",
    "    print(\"\\n3. Evaluating Models...\")\n",
    "    \n",
    "    # Attention-LSTM predictions\n",
    "    attention_pred = attention_model.predict(X_test).flatten()\n",
    "    attention_rmse, attention_mae, attention_mape = calculate_metrics(y_test, attention_pred)\n",
    "    \n",
    "    # Standard LSTM predictions\n",
    "    standard_pred = standard_model.predict(X_test).flatten()\n",
    "    standard_rmse, standard_mae, standard_mape = calculate_metrics(y_test, standard_pred)\n",
    "    \n",
    "    # Store results\n",
    "    results['attention_lstm'] = {\n",
    "        'model': attention_model,\n",
    "        'history': attention_history,\n",
    "        'predictions': attention_pred,\n",
    "        'rmse': attention_rmse,\n",
    "        'mae': attention_mae,\n",
    "        'mape': attention_mape\n",
    "    }\n",
    "    \n",
    "    results['standard_lstm'] = {\n",
    "        'model': standard_model,\n",
    "        'history': standard_history,\n",
    "        'predictions': standard_pred,\n",
    "        'rmse': standard_rmse,\n",
    "        'mae': standard_mae,\n",
    "        'mape': standard_mape\n",
    "    }\n",
    "    \n",
    "    return results\n",
    "\n",
    "def main():\n",
    "    \"\"\"Main execution function\"\"\"\n",
    "    \n",
    "    print(\"ADVANCED TIME SERIES FORECASTING WITH ATTENTION-BASED LSTM\")\n",
