    "    plt.title('Sample of Generated Features (First 200 Time Steps)')\n",
    "    plt.legend()\n",
    "    plt.grid(True, alpha=0.3)\n",
    "    \n",
    "    plt.subplot(3, 1, 2)\n",
    "    plt.plot(target[:200], color='red', linewidth=2)\n",
    "    plt.title('Sample of Target Variable (First 200 Time Steps)')\n",
    "    plt.grid(True, alpha=0.3)\n",
    "    \n",
    "    plt.subplot(3, 1, 3)\n",
    "    plt.plot(target, color='red', linewidth=1, alpha=0.7)\n",
    "    plt.title('Full Target Variable Series')\n",
    "    plt.grid(True, alpha=0.3)\n",
    "    \n",
    "    plt.tight_layout()\n",
    "    plt.show()\n",
    "    \n",
    "    # 2. Preprocess data\n",
    "    print(\"\\n2. PREPROCESSING DATA...\")\n",
    "    preprocessor = TimeSeriesPreprocessor(lookback=60, train_ratio=0.7, val_ratio=0.15)\n",
    "    X_train, y_train, X_val, y_val, X_test, y_test = preprocessor.prepare_data(data, target)\n",
    "    \n",
    "    print(f\"Training data: {X_train.shape}, {y_train.shape}\")\n",
    "    print(f\"Validation data: {X_val.shape}, {y_val.shape}\")\n",
    "    print(f\"Test data: {X_test.shape}, {y_test.shape}\")\n",
    "    \n",
    "    # 3. Perform ablation study\n",
