    "    # Plot predictions\n",
    "    plot_predictions(y_test, results['attention_lstm']['predictions'], 'Attention-LSTM')\n",
    "    plot_predictions(y_test, results['standard_lstm']['predictions'], 'Standard LSTM')\n",
