    "    # 5. Attention mechanism visualization\n",
    "    print(\"\\n5. VISUALIZING ATTENTION MECHANISM...\")\n",
    "    \n",
    "    # Plot attention weights for several samples\n",
    "    attention_model = results['attention_lstm']['model']\n",
    "    for sample_idx in [0, 50, 100]:\n",
    "        top_steps, weights = plot_attention_weights(attention_model, X_test, sample_idx, lookback=60)\n",
    "        print(f\"Sample {sample_idx} - Top 5 attention time steps: {top_steps}\")\n",
    "        print(f\"Corresponding weights: {weights[top_steps]}\")\n",
    "    \n",
    "    # 6. Comparative analysis\n",
    "    print(\"\\n6. COMPARATIVE ANALYSIS RESULTS\")\n",
    "    print(\"=\" * 60)\n",
    "    \n",
    "    metrics_data = {\n",
    "        'Model': ['Attention-LSTM', 'Standard LSTM'],\n",
    "        'RMSE': [results['attention_lstm']['rmse'], results['standard_lstm']['rmse']],\n",
    "        'MAE': [results['attention_lstm']['mae'], results['standard_lstm']['mae']],\n",
    "        'MAPE': [results['attention_lstm']['mape'], results['standard_lstm']['mape']]\n",
    "    }\n",
    "    \n",
    "    metrics_df = pd.DataFrame(metrics_data)\n",
    "    print(\"\\nPerformance Metrics Comparison:\")\n",
    "    print(metrics_df.to_string(index=False, float_format='%.4f'))\n",
    "    \n",
    "    # Calculate improvement\n",
    "    rmse_improvement = ((results['standard_lstm']['rmse'] - results['attention_lstm']['rmse']) / \n",
